import React from "react";
import ReactDOM from "react-dom";

interface AppProps {
  color: string;
  other?: boolean;
}

class App extends React.Component<AppProps> {
  state = { counter: 0 };
  render() {
    return <div>{this.props.color}</div>;
  }
}

ReactDOM.render(<App color="red" />, document.querySelector("#root"));
